import React from "react";
import {
  Switch,
  Route,
} from "react-router-dom";
import Home from "../Content/Home";

function RouterURL() {
    return ( 
        <Switch>
            <Route exact path="/">
                <Home />
            </Route>
        </Switch>
    );
}

export default RouterURL;
